import React from 'react';

class Titles extends React.Component{
  render(){
    return (
      <div>
      <h1>Weather Finder</h1>
      <p className="title-container__subtitle">Find Out Temperature, Condition, and More....</p>
      </div>
    )
  }
}

export default Titles;
